import './OurStatistics.css'

function OurStatisticsNum(props) {
  return (
    <>
    {
        props.item.map(
            stat => (
                <div className="col-12 col-md-3 pb-5 mb-3">
                    <div className="text-center text-white">
                        <p className='display-3'>{stat.number}+</p>
                        <p className='display-6'>{stat.title}</p>
                    </div>
                </div>
            )
        )
    }
    
    {/* card1 */}
        
    {/* card1 */}
        <div className="col-12 col-md-3">
            <div className="text-center text-white">
                <h1 className='display-3'>1240</h1>
                <p className='display-6'>Club</p>
            </div>
        </div>
    {/* card1 */}
        <div className="col-12 col-md-3">
            <div className="text-center text-white">
                <h1 className='display-4'>1240</h1>
                <p className='display-6'>Club</p>
            </div>
        </div>
        
    </>
  )
}

export default OurStatisticsNum
